var main = document.querySelector('main')
var displayGame = document.getElementById('displayGame')
var terre = document.getElementById('terre')
var bateauNum = {}
var batNbr = 0
var canon = document.getElementById('canon')
var vitesseBat = 3
// var vitesseBat = 50
var creationBat = 5000
var bateauCoule = 0
var vie = document.getElementById('vie')
var vieTotale = 3
// var vieTotale = 1
vie.textContent = vieTotale


function createBoat() {
    var bateau = new Image(300, 300)
    bateau.src = "images/bat.png"
    bateau.classList = "numero"
    // position de départ du bateau
    // création automatique de bateau
    switch (bateauCoule) {
        case 3:
            vitesseBat = 5
            break;
        case 6:
            clearInterval(first)
            first = setInterval(createBoat, 3000)
            break;
        case 9:
            vitesseBat = 7
            break;
        case 12:
            clearInterval(first)
            first = setInterval(createBoat, 2000)
            break;
        case 20:
            clearInterval(first)
            first = setInterval(createBoat, 1900)
            // vitesseBat = 8
            break;
        case 25:
            clearInterval(first)
            first = setInterval(createBoat, 1800)
            break;
        case 30:
            clearInterval(first)
            first = setInterval(createBoat, 1700)
            break;
        case 35:
            vitesseBat = 10
            break;
    }
    abordage(bateau)
}


// if(bateauCoule >= 8){
//     setInterval(createBoat, 5000);
// }



function abordage(bat) {
    bat.style.position = "absolute"
    var posBateauDepart = displayGame.offsetWidth
    bat.style.top = displayGame.offsetHeight - 300 + "px"
    bat.style.left = posBateauDepart + "px"
    displayGame.appendChild(bat)
    function noeud() {
        posBateauDepart -= vitesseBat
        bat.style.left = posBateauDepart + "px"
        // console.log(bouletX)
        if (posBateauDepart <= terre.offsetWidth) {
            vieTotale-= 1
            vie.textContent = vieTotale
            clearInterval(finNavigation)
 
            // Mettre en place un systeme de point de vie à enlever
        }
        
    }
    var finNavigation = setInterval(noeud, 100)
    if (bat.offsetLeft <= terre.offsetWidth) {
        console.log('yopla')
        vieTotale-= 1
        vie.textContent = vieTotale
        // Mettre en place un systeme de point de vie à enlever
    }
    if (vieTotale <=0){
        clearInterval(first)
        main.style.display ="none"
        document.getElementById('scoreFinal').textContent = bateauCoule
        document.getElementById('modale').style.display = "flex"

    }

}
var first = setInterval(createBoat, 5000)

createBoat()


var mot = []
var champs = document.getElementById('champs')
champs.focus()
var textDepart = document.getElementById('textDepart')
function choixNbr(tableau, division, depart, fin, lettre) {
    for (let a = 0; a < tableau.length / division; a++) {
        lettre.push(tableau.slice(depart, fin))
        depart += division
        fin += division
    }
}

function getRandomInt(max) {
    return Math.floor(Math.random() * Math.floor(max))
}

function text(valeur) {
    textDepart.textContent = ""
    valeur = getRandomInt(8)
    switch (valeur) {
        case 0:
            choixNbr(un, 1, 0, 1, mot)
            textDepart.textContent = mot[getRandomInt(mot.length)]
        case 1:
            choixNbr(deux, 2, 0, 2, mot)
            textDepart.textContent = mot[getRandomInt(mot.length)]
            break;
        case 2:
            choixNbr(trois, 3, 0, 3, mot)
            textDepart.textContent = mot[getRandomInt(mot.length)]
            // console.log(textDepart.textContent)
            break;
        case 3:
            choixNbr(quatre, 4, 0, 4, mot)
            textDepart.textContent = mot[getRandomInt(mot.length)]
            // console.log(textDepart.textContent)
            break;
        case 4:
            choixNbr(cinq, 5, 0, 5, mot)
            textDepart.textContent = mot[getRandomInt(mot.length)]
            // console.log(textDepart.textContent)
            break;
        case 5:
            choixNbr(six, 6, 0, 6, mot)
            textDepart.textContent = mot[getRandomInt(mot.length)]
            // console.log(textDepart.textContent)
            break;
        case 6:
            choixNbr(vingt, 20, 0, 20, mot)
            textDepart.textContent = mot[getRandomInt(mot.length)]
            // console.log(textDepart.textContent)
            break;
        case 7:
            choixNbr(vingtetun, 21, 0, 21, mot)
            textDepart.textContent = mot[getRandomInt(mot.length)]
            // console.log(textDepart.textContent)
            break;

        default:
            break;
    }
}


