function tir() {

    // Récupération de l'image boulet
    var boulet = new Image(90, 90)
    boulet.src = "images/boulet.png"
    boulet.style.position = "absolute"
    var bouletX = canon.offsetWidth
    var bouletY = displayGame.offsetHeight - 200

    // Position de départ
    boulet.style.left = bouletX + 'px'

    boulet.style.top = bouletY + 'px'
    displayGame.appendChild(boulet)
    function tirer() {
        boulet.style.left = bouletX + 'px'
        bouletX += 15
        if (bouletX >= displayGame.offsetWidth) {
            displayGame.removeChild(boulet)
            clearInterval(finTir)

        } else if (bouletX >= document.getElementsByClassName('numero')[0].offsetLeft) {
            displayGame.removeChild(document.getElementsByClassName('numero')[0])
            displayGame.removeChild(boulet)
            bateauCoule++
            document.getElementById('bateauCoule').textContent = bateauCoule
            vieTotale+=1
            clearInterval(finTir)
        }
    }
    var finTir = setInterval(tirer, 50)
    // console.log(bateauCoule)
}

